import React, {Component}  from 'react';
import {View, Text, StyleSheet} from 'react-native';
import Axios from 'axios';


export default class PrimeiroComponente extends Component {
    state = {
        avatar: "",
        email: "",
        first_name: "",
        last_name: "",
        id: 0
    }


    
    componentDidMount(){
        Axios.get("https://reqres.in/api/users")
        .then(response =>{
            this.setState({ email: response.data.data[0].email})
           console.log(response.data.data[0].first_name); 
        })
    }
    
    render() {
        return(

            <View>
                <Text style={styles.titulo}>Meu Primeiro componente está funcionando!</Text>
                <Text style={styles.paragrafo}>Só mais um texto</Text>
            </View>   
          
        );
    }
}

const styles = StyleSheet.create({

titulo: {
    fontSize:40,
    fontStyle:"italic",
    color:"000021"
},
    paragrafo:{
        fontSize: 20,
        color:"000060"
    }

});
